// import addIcon from '../resources/add.svg';
import addIcon from '../../../node_modules/bootstrap-icons/icons/plus-circle-fill.svg';
import IconButton from '../IconButton/IconButton';
function AddNewCookieBtn(props){
    return(
        <div className= 'div-add-button position-fixed'>
            <IconButton>
            <svg xmlns="http://www.w3.org/2000/svg" width="48" height="48" className="bi bi-plus-circle" viewBox="0 0 16 16">
                <path d="M8 15A7 7 0 1 1 8 1a7 7 0 0 1 0 14zm0 1A8 8 0 1 0 8 0a8 8 0 0 0 0 16z"/>
                <path d="M8 4a.5.5 0 0 1 .5.5v3h3a.5.5 0 0 1 0 1h-3v3a.5.5 0 0 1-1 0v-3h-3a.5.5 0 0 1 0-1h3v-3A.5.5 0 0 1 8 4z"/>
            </svg>
            </IconButton>
        </div>
    );
}

export default AddNewCookieBtn;
